const WeatherTypes = {
  'clear': '☀️',
  'pcloudy': '🌤️',
  'mcloudy': '🌥️',
  'cloudy': '⛅️',
  'humid': '🌤️',
  'lightrain': '🌧️',
  'oshower': '🌦️',
  'ishower': '💧',
  'lightsnow': '🌨️',
  'rain': '🌧️',
  'snow': '🌨️',
  'rainsnow': '🌧️',

}

const DayWeather = ({weatherType}) => {
  const [weather, setWeather] = useState('clear')
  const [weatherIcon, setWeatherIcon] = useState('☀️')

  useEffect(() => {
    setWeather(weatherType)
    setWeatherIcon(WeatherTypes[weather])
  }, [])

  return (
    <div>
        <div>{weather}</div>
        <div>{weatherIcon}</div>
    </div>
  )
}

export default DayWeather
